let initialState = {
    friendData: [
        { name: 'Jessica', id: 1 },
        { name: 'John', id: 2 },
        { name: 'Jacob', id: 3 }
    ]
};

const navbarReducer = (state = initialState, action) =>{
    return state;
}

export default navbarReducer;
